INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2030/12/31 15:00:00", "かりん", 0, 37, 2.0, 118501, 450, 118501, 787, "【魔法】後衛で皆を支える、ギルド管理協会の職員さん。\n通常攻撃の代わりに味方の能力を高める魔法を掛け、\n味方の守護や敵への妨害など、完璧なサポートをこなす。", 37, 1, 0, 0, 0, 1, "カリン", "2021/10/19 12:00:00", 118501, 118501, 2, 0, 0, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2030/12/31 15:00:00", "ねびあ", 0, 0, 2.0, 118601, 450, 118601, 826, "【魔法】後衛を飛び出し悪戯の限りを尽くす幻惑の妖精。\n敵陣を勝手気ままに飛び回り、敵の攻撃を空振りさせて、\nＵＢで４種の妨害効果をランダムに与え大混乱に陥れる。", 0, 3, 0, 0, 0, 1, "ネビア", "2024/08/10 21:00:00", 118601, 118601, 2, 0, 0, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2030/12/31 15:00:00", "いお", 0, 7, 2.27, 119001, 450, 119001, 714, "【魔法】後衛で魔法アタッカーを妨害する闇のせんせー。\n最も魔法攻撃力が高い敵を、誘惑とＴＰダウンで妨害し\nＴＰ回復スキルで味方を援護することで戦況を支配する。", 7, 3, 0, 0, 15, 0, "イオ（ノワール）", "2021/11/03 19:00:00", 119001, 119001, 2, 0, 0, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2030/12/31 15:00:00", "くうか", 0, 26, 2.545, 119101, 450, 119101, 143, "【魔法】前衛で、猛攻をバリアで受けきる闇のドＭ娘。\n最も魔法攻撃力が高い味方の魔法攻撃力とクリティカルを\nアップさせ、魔法防御力ダウンスキルで敵を怯ませる。", 7, 3, 0, 0, 12, 0, "クウカ（ノワール）", "2021/11/16 12:00:00", 119101, 119101, 2, 0, 0, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2030/12/31 15:00:00", "まひる", 0, 6, 2.19, 119201, 450, 119201, 397, "【物理】中衛で味方を支援し、守護する聖夜の牧場主。\n範囲内の敵をノックバックさせることで相手の隊列を崩し\n全体物理バリア展開と単体ＨＰ回復で激戦を勝利に導く。", 6, 1, 0, 0, 5, 1, "マヒル（クリスマス）", "2023/09/19 15:00:00", 119201, 119201, 1, 0, 0, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2030/12/31 15:00:00", "りの", 0, 8, 1.97, 119301, 450, 119301, 762, "【物理】後衛で、攻撃と支援を担う聖夜のアーチャー。\n物理攻撃力と物理クリティカルアップスキルで周囲を強化\nし、クリティカルで威力が増大するＵＢで敵を粉砕する。", 8, 3, 0, 0, 6, 0, "リノ（クリスマス）", "2021/12/22 12:00:00", 119301, 119301, 1, 0, 0, 0);
