INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2030/12/31 15:00:00", "ぷれしあ", 0, 1, 0.0, 131501, 0, 131501, 0, "", 1, 3, 0, 0, 0, 1, "プレシア", "2015/04/01 15:00:00", 0, 0, 0, 0, 1, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2024/07/26 11:59:59", "りり", 0, 4, 1.92, 131601, 450, 131601, 399, "【物理】中衛で、夏の陽光のもと研鑽する妹系大和撫子。\n防御力アップに加えバリアやＨＰ回復で味方の守りを固め\nＴＰ回復や攻撃力ダウンをも巧みに操り、場を支配する。", 4, 3, 0, 0, 0, 1, "リリ（サマー）", "2024/07/15 15:00:00", 131601, 131601, 1, 0, 0, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2024/08/12 11:59:59", "あめす", 0, 53, 1.92, 131701, 450, 131701, 743, "【魔法】後衛で、黄昏の水面に舞い降りる水着姿の妖精。\n行動速度アップやＴＰ支援をはじめとした多数のサポート\nを施しつつ、ＵＢの攻防弱体化で清爽に勝利へと導く。", 44, 3, 0, 0, 0, 1, "アメス（サマー）", "2024/07/31 12:00:00", 131701, 131701, 2, 0, 0, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2030/12/31 15:00:00", "ほまれ", 0, 21, 2.09, 131801, 450, 131801, 709, "【魔法】後衛で夏の清涼に翼を休める水着姿の龍の首領。\n攻防弱体化に加え、ステータスダウン付与のたび増加する\n【日食】の数に応じたダメージで、抗う全てを灰に帰す。", 7, 3, 0, 0, 0, 0, "ホマレ（サマー）", "2024/08/15 15:00:00", 131801, 131801, 2, 0, 0, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2030/12/31 15:00:00", "えみりあ", 0, 23, 2.09, 131901, 450, 131901, 725, "【魔法】後衛で、パックと共に戦う真夏のハーフエルフ。\n氷壁を生成するスキルや、強力なダメージと速度ダウンを\n付与するユニオンバーストで、敵の侵攻を食い止める。", 7, 1, 0, 0, 0, 1, "エミリア（サマー）", "2024/08/31 12:00:00", 131901, 131901, 2, 0, 1, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2024/09/25 11:59:59", "えきどな", 0, 21, 2.09, 132001, 450, 132001, 775, "【魔法】後衛で未知の世界との邂逅に胸躍る強欲の魔女。\n鮮烈な攻撃魔法をはじめ、味方への攻撃支援、敵の弱体化\nから自己蘇生まで、あらゆる魔法を振るい、欲を満たす。", 7, 3, 0, 0, 0, 1, "エキドナ（サマー）", "2024/09/13 12:00:00", 132001, 132001, 2, 0, 0, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2024/09/13 11:59:59", "れむ", 0, 24, 2.09, 132101, 450, 132101, 146, "【物理】前衛で夏の日差しの中、余暇を楽しむ双子の妹。\nＵＢで鬼族の力を解放すると攻防両面に加えＨＰ吸収が\n上昇し、目に映る全てを【狂騒】のままに叩き伏せる。", 13, 3, 0, 0, 0, 1, "レム（サマー）", "2024/08/31 12:00:00", 132101, 132101, 1, 0, 0, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2024/10/10 11:59:59", "のぞみ", 0, 7, 1.84, 132201, 450, 132201, 721, "【魔法】後衛で、希望を錬成するアルケミストアイドル。\n【錬金素材】から【パフューム】を創り、ダメージに加え\nＴＰ回復や攻撃支援能力を向上させて勝利の香りを運ぶ。", 7, 3, 0, 0, 0, 1, "ノゾミ（アルケミスト）", "2024/09/30 12:00:00", 132201, 132201, 2, 0, 0, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2024/12/09 11:59:59", "らいらえる", 0, 0, 2.09, 132801, 450, 132801, 750, "【魔法】後衛で、雪白の肌を黒衣に包んだ甘美なる姫君。\n味方のＨＰを代償に強力なバリアを展開しつつ、バリアを\n起点とした高出力の二連撃で、聖夜の大樹に灯を点す。", 7, 3, 0, 0, 0, 1, "ライラエル（クリスマス）", "2024/11/30 12:00:00", 132801, 132801, 2, 0, 0, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2030/12/31 15:00:00", "いお", 0, 46, 2.09, 132901, 450, 132901, 748, "【魔法】後衛で、心地良い眠りの中に訪れる聖夜の悪魔。\n最も魔法攻撃力が高い味方に【悪魔の口づけ】を付与し、\n攻撃支援とＴＰ回復による付きっきりの手ほどきをする。", 5, 3, 0, 0, 0, 0, "イオ（クリスマス）", "2024/12/09 12:00:00", 132901, 132901, 2, 0, 0, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2025/01/03 18:59:59", "ぐれいす", 0, 0, 2.09, 133001, 450, 133001, 234, "【物理】前衛で、宙を舞うように戦う幽霊の守護騎士。\nＵＢで味方の攻撃と速度支援を行い、【レイスボディ】で\n敵の目を逃れ、不意を突く一撃で永遠の眠りにつかせる。", 0, 3, 0, 0, 0, 1, "グレイス", "2024/12/31 12:00:00", 133001, 133001, 1, 0, 0, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2030/12/31 15:00:00", "もにか", 0, 22, 2.09, 133201, 450, 133201, 296, "【物理】前衛で、元日も元気にはしゃぎまわる軍人少女。\n与ダメージに応じて追加効果が強化されるＵＢと、発動ご\nとに成長する自己強化スキルで秩序を乱す者の目を回す。", 4, 1, 0, 0, 0, 1, "モニカ（ニューイヤー）", "2024/12/31 12:00:00", 133201, 133201, 1, 0, 1, 0);
INSERT INTO `v1_13dd2ff122626b2d7fc8325924cbe94891f7134df6091d961ed71bfc96084a8a` VALUES ("2025/01/15 14:59:59", "されん", 0, 22, 2.09, 133501, 450, 133501, 718, "【魔法】後衛で、傍らで心を重ねる振袖姿の救護院の主。\n味方へのＴＰ回復の支援をしつつ、味方がＵＢを発動する\nたびダメージが上がるスキルで、共に困難を乗り越える。", 4, 3, 0, 0, 0, 1, "サレン（ニューイヤー）", "2025/01/03 19:00:00", 133501, 133501, 2, 0, 0, 0);
